(7283, 'Kaffen', 'Som så mange andre går vi meget op i kaffe, både hvad angår smag, kvalitet og oprindelse. Derfor har vi valgt at forhandle kaffe og espresso fra en af vores lokalleverandører KONTRA COFFEE. ', 1, '5396a1478c4a87283', 57),
(7303, 'Vores bageri', 'I bageriet hos Wulff og Konstali Food Shop på Lergravsvej bliver der bagt brød og kager natten lang af vores dygtige bagerteam.  Inspireret af tid og trends bliver alt bagt fra bunden og med håndkraft.', 1, '5396a29c312f97303', 57),
(7304, 'Brunch', 'Vi er rigtig stolte af at kunne præsentere Wulff + Konstalis helt nye skud på stammen: Brunchen! Her sammensætter du selv hvad du har lyst til fra vores spiseseddel med 18 forskellige komponenter. Brødet er selvfølgelig friskbagt fra vores eget bageri.', 1, '5396a29c319c87304', 57),
(7305, 'Kolonialvarer og delikatesser', 'I kølemontrene har vi hjemmelavet hummus, pesto og relish, frikadeller, panini, sancwiches, salater og frittatas. Vi plukker og sælger æbler og pærer i sæsonen og laver vores egen skønne müsli.', 1, '5396a29c320147305', 57),
(7306, 'Manamanam', 'Manamanam er vores egen produktion af færdigretter og supper på frost, der er udviklet for at lette aftensmåltidet for de travle. Tanken bag manamanam er, at det skal være nemt og hurtigt at lave lækker aftensmad. Velbekomme!', 1, '5396a29c355ad7306', 57),
