(8025, 'Kaffevogn', 'Den første kaffevogn havde sin debut på Islands Brygge en dejlig sommerdag i 2007. Siden er flere biler kommet til, og Kaffekværnen har nu 7 kaffebiler, som kører byen tynd på hverdage mellem 8-16.00. ', 1, '5396cbd4718a88025', 60),
