(8067, 'Mobil kaffebar', 'Nogen gange er en god kop kaffe nok til at efterlade os med et smil om munden resten af dagen. Kaffekværnen kan bringe dette ritual af nydelse til dine medarbejdere i form af Mobil Kaffebar/Minibaren.', 1, '5396cf22c62468067', 60),
(8068, 'Virksomhedskaffe', 'Kaffekværnens kaffebarer er 100 % omkostningsfri for virksomheden, og selvom pladsbehovet er lille, er tilfredsheden stor. Kaffebaren er den mest populære af vores inhouse løsninger og med god grund.', 1, '5396cf22c68648068', 60),
