(554, 'Bemærk:', 'Køkkenet lukker alle dage kl 21.30 ', 24, 1),
(703, 'Om Cafe Alma', 'Alma betyder sjæl. Cafeen ligger på Islands Brygge, og fungerer som samlingspunkt for de unge, familierne og mange af de lokale som mødes til kaffe, frokost, aftensmad og den berømte brunch.\n\nCafeen ligger i et rustikt kælderlokale, der engang var porcelæn.\nHjemmeside: www.cafealma.dk', 30, 1),
(733, 'Overskift', 'Her kan du skrive oplysninger om dit sted!', 31, 1),
(774, 'Velkommen til kaffehuset', 'Kom ind og nyd din kaffe, der er brygget med kærlighed og smag byens bedste hjemmelavede milkshakes i byens hyggeligste café.\nVi byder på kærlighed og fri internet ???', 32, 1),
(837, 'Velkommen til Kaffeplantagen', 'Kaffeplantagen på Sankt Hans Torv er den første af vores kaffebarer som åbnede i 2004 og blev kåret til Byens Bedste Kaffebar i 2007 af AOK. Foruden kaffe kan man købe morgenmad, the, smoothies, chokolade, kager, raw barer, Hansen is, m.m., samt de seneste gadgets indenfor kaffebrygning og hele kaffebønner vi maler for dig på stedet. \n\nStemningen er hyggelig og vores høje barborde i de store vinduespartier er altid fyldt med glade gæster, der kigger ud på det travle Sankt Hans Torv, læser avisen eller arbejder på deres bærbar computer. Der er borde og stole udenfor så du kan nyde din kaffe i solen, både om formiddagen og om eftermiddagen. \n\nKort sagt er her et leben uden lige, mennesker der sidder her i timer eller andre der blot smutter forbi for at tage en takeaway med på en gåtur ved søerne. I øvrigt serverer vi flere slags øko mælk eller varianter af soyamælk + laktosefri mælk til din yndlings kaffe.', 33, 1),
(931, 'Velkommen til Sebastopol', 'Sebastopol, en af de ældste caféer på Nørrebro, åbnede dørene for første gang i oktober 1994. Lige siden har Sebastopol bragt den originale franske caféstemning til danskerne.\nNu er tiden inde, til at bringe den franske Bistro kultur til København. Vi vil hver dag servere originale bistro retter, og vi vil gøre det på den rigtige måde!  Hurtig servering af gode smagsfulde retter, ledsaget af et godt glas vin ? af vores egen import af gode vine fra det meste af sydfrankrig.\nDet hele gerne efterfulgt af en velsmagende dessert, og en god kop kaffe.', 34, 1),
(985, 'Overskift', 'Her kan du skrive oplysninger om dit sted!', 35, 1),
(1022, 'Velkommen til ROD', 'Slagter, Grønthandler og  Café"', 36, 1),
(1168, 'Velkommen til Cafe Plenum', 'Det har altid været vores drøm at have et sted med masser af hygge &amp;amp;amp;amp;amp;amp; kvalitet. Og at vise, at den kvalitet der er et must ikke nødvendigvis behøver at koste alverden, bare fordi den bliver serveret på Sankt Hans Torv. Vi ønsker at have et sted hvor du føler dig hjemme og får lyst til at komme igen snart.', 37, 1),
(1408, 'Malbeck Vinoteria', 'Halv pris søndag-torsdag ml. 16-18 på hele glaskortet. Inkl. solskin i sommerhalvåret.\nHvad er vi\n\nMalbeck Vinoteria er et spisested med et selvironisk hint til cafeteria. En plads for alle medarbejderne i fabrikken, der skal have en pause og nyde en bid mad. Vi gør en stor dyd ud af, at vores sted skal være low-key, hyggeligt, atmosfærisk og nærværende. Som kunde skal du prøve at lægge mærke til akustikken, belysningen og musikken. Kan du lide at være der? Hvis ikke, har vi gjort noget forkert, og så vil vi gerne vide det.\n\nOplevelsen\n\nVi lægger stor vægt på, at vores kunder bliver set og hørt. Der kan være travlt, men du bliver altid mødt med en hilsen - vi har set dig og vi er straks hos dig. Vi ønsker nærvær i vores lille forretning og frem for alt en holdning til tingene. På vinsiden startede vi for 6 år siden med at importere vine fra Argentina og denne bølge af vedvarende nysgerrrighed omkring dette land er stadig vores hovedvægt. Vi sørger for kultmængder, altså vine, der er lavet i meget små størrelser og som kun sælges her.\n\nDet samme gælder køkkenet, hvor vi har skabt en køkkenfilosofi, der ligger i forlængelse af vores ambitioner og tænkte former i vinbaren. Råvarerne er rene og ukonventionelle og hver ret ligner en lille gudetallerken og smager af så meget, at morfar falder bagover og ned af barstolen. Nogen kalder det tapas, hjælp os med at sætte ord på disse anretninger, for tapas er det ikke.\n\nVinen\n\nVi startede med at importere vine fra Argentina i 2006, hvor der i Istedgade landede to paller vin, vi ikke vidste, hvordan vi skulle sælge. Efterhånden er vi stille og roligt vokset og importerer i dag også vine fra Østrig, Tyskland, Spanien og Frankrig. Derfor er smagsoplevelserne på Vinoteria enorme, og vi gør alt for at tilfredsstille gæsternes gane.\n\nGlæden og engagementet\n\nVi gør det her, fordi vi har lyst. Vi elsker god mad og gode vine. Og hygge! Vi skal gi'' jer, ja vi ska''. Når det ikke er sjovt længere, så lukker vi. Ganske enkelt. Når man driver et lille sted med hjerteblod, så skal lysten være med. Bliver det surt, må man se det i øjnene og give op. Lige nu kan vi bare ikke få armene ned af begejstring. Heldigvis.\n\nVelkommen!"', 39, 1),
(1483, 'Gefährlich', 'Få minutter fra City ligger en af Nørrebros mest populære restauranter og natklubber. I dag- og aftentimerne er Gefährlich et traditionelt spisested med både velkendte danske retter og mere utraditionelle indslag på menuen - som for eksempel køkkenets populære stegt flæsk med persillesovs. Men når mørket sænker sig, forvandles Gefährlich til en uhøjtidelig og intim natklub, hvor en lang række af scenens bedste DJ?s spiller de bedste fra pladesamlingen. Derudover byder Gefährlichs kyndige bartendere også på et imponerende og eksklusivt udvalg af velkendte og nye cocktails.\n\n///\n\nGefährlich på Nørrebro er både et traditionelt spisested med danske klassikere på menuen, og en populær natklub, hvor byens bedste DJ?s leverer en af Københavns bedste fester.', 40, 1),
(1497, 'Soup Natural (Guldbergsgade)', 'Soupanatural på Guldbergsgade har eksisteret siden marts 2008 ? lokalet har ændret fysisk udseende en del gange siden åbningen. Vi kan nu have 26 spisende gæster i vores lokale, men for at bestille bord skal man være minimum 4 personer.\nVi kører med en fast økologisk menu, hvor vores kok har sørget for at det oplagte toppingvalg følger med suppen. Det eneste vi beder dig om at tage stilling til, er om du vil nyde suppen i vores lokaler eller om du vil have den med hjem i vores miljøvenlige emballage.\n\nDen nuværende menu for Soupanatural finder du under fanebladet ?Maden? her på hjemmesiden.\n\nVi lukker ned for suppen kl. 22 fredage og lørdage, hvorefter suppen kun kan tages to-go, da vi efter kl. 22 forvandler stedet til en cocktailbar. Vi ligger overfor Rust natklub, som gør også idelle som et opvarmningsted. Vi har et cocktailkort som gerne smags- og prismæssigt kunne sætte gang i humøret til en festlig aften videre i byen.\n\nHvis du har lyst til at bruge lokalet, så tilbyder vi en god rabat på vores produkter uanset om du vil holde lukket eller åbent privatarrangement.\n\nRing os op på tlf. 32 13 17 35 eller send os en mail på info@soupanatural.dk og hør hvilke muligheder der er for dig og dit selskab."', 41, 1),
