(1714, 'Viste du, at du kan få 20% i studierabat på maden', 'Det gælder ikke varer under 50 kr,-\nheller ikke ved bestling online', 43, 1),
(1715, 'Ultimatum Brunch', 'Lørdag   Søndag Fra kl. 11.00 - 14.00\n\nHver lørdag og søndag kan du opleve vores pragtfulde brunch buffet som består af bl.a.\n\nPastasalat, kartofler m. flødesauce, røræg, 3 slags skinke, bacon, stegt pølse, chorizo, 3 slags ost, 2 slags marmelade, pandekager med ahornsirup, frugt, og meget mere.\nkafee / te / juce, rugbrød, brød, yoghurt   frugt;', 43, 1),
(1716, 'Arrangement', 'Skal I holde firmafest, barnedåb, bryllup, konfirmation, jubilæum, fødselsdag eller lignende, så er det oplagt at komme hos os. Vi serverer deluxe buffet til enhver smag læse mere\n\nKolde retter\n\nPastasalat: luksus artiskok, rucola, paprika, oliven, soltørrede tomat og pesto.\nTzazik: yoghurt naturel med hvidløg og agurk\nHumus: kikærten med tahini og citron\nTomat salat: med oliven, rucola, fetaost, løg og pesto\nGrønt salat\nSæson frugt\nVarme retter\n\nKylling i timian og grøntsager\nOksekødstrimler: med champignon, koriander, og aubergine\nFlødekartofler med pebermix og rosmarin\nRis: med diverse grøntsager\nOvnstegte grøntsager: paprika, squash, aubergine, løg og kartofler\nLasagnen med kødsauce, ost og bechamelsauce\nFalafel\nFriskbagt brød og sæson frugt er inkluderet\n\nBuffetten kan kombineres efter jeres ønsker, og kan bestilles ved minimum 12 personer, husk at bestille senest 2 dager før.\n\n189,- kr/person', 43, 1),
(1717, 'Kontakt telefonisk ved bestilling af mad eller bord', '35811884', 43, 1),
(1745, 'Velkommen til Cafe Fata''Morgana', 'HAR DU VÆRDIBEVISER FRA Groupon &amp; Tilbudibyen KAN DU BESTILLE ET BORD TIL OP TIL 6 PERS. \n\nDINE VÆRDIBEVISER KAN IKKE KOMBINERES MED ANDRE TILBUD. VÆRDIBEVISER FRA Groupon &amp; Tilbudibyen MEDBRINGES UDSKREVET. \n\nDU KAN IKKE BESTILLE FLERE BORDE SAMME DAGE ELLER KOMBINERE FLERE BORDE SAMMEN, HVERKEN UNDER ET NAVN ELLER FLERE NAVNE.', 42, 1),
(1772, 'NYT FRA GRØDLABORATORIET', 'Kære grødkammerater. Mottoet for GRØD har i 2014 været at "få styr på tingene". Siden åbningen i 2011 har der mildest talt været fuld hammer på. 2 butikker, en kogebog, roskilde festival, vm i havregrød og risotto, diverse foredrag og workshops, er det so far blevet til. Vi har brugt hele foråret til at gøre butikkerne flottere og grøden bedre. Sommeren byder bl.a. på den legendariske sommergrødmenu, Roskilde Festival og VM i risotto...Og vi kan også røbe, at vi skal til at lege sammen med vores venner fra Aarstiderne i løbet af sensommeren! Masser af sommerkærlighed fra GRØDFAMILIEN', 44, 1),
(1784, 'Overskift', 'Her kan du skrive oplysninger om dit sted!', 45, 1),
(1811, 'Pussy Galore', 'Pussy Galore?s Flying Circus er en ikonisk københavner café med beliggenhed på Sankt Hans Torv i den livlige Nørrebro.\nIndretningen er casual og klassisk på samme tid og atmosfæren er både afslappet og livlig.\nCaféen er mødested for hipsters, studerende, forretningsfolk, barselsmødre, designere og sågar beboere fra det lokale plejehjem. Pussy Galore fungerer næsten som andet hjem for mange lokale beboere - men vi har altid døren åben for alle!\nNår solen skinner på København tilbyder Pussy Galore byens ultimativt bedste udendørsservering. Vi har ganske enkelt det mest fantastiske spot til at nyde kolde øl, lækre cocktails, kvalitetskaffe, eller en appetitlig anretning - alt imens man betragter torvets farverige leben.\nIndenfor er caféen et ideelt sted at mødes med venner, en date, uformelle arbejdsmøder, pre-clubbing, eller bare en god aften ude', 46, 1),
(1843, 'Welcome to mad hatter bubble tea emporium', '', 47, 1),
(1865, 'Overskift', 'Her kan du skrive oplysninger om dit sted!', 48, 1),
(1971, 'Velkommen til Kaffesalonen grundlagt 1933', 'Kaffesalonen på Nørrebro er det ideelle sted for dig der kan lide lækker cafémad samt hyggelig stemningsfuld atmosfære. Med dens centrale og pragtfulde beliggenhed ud til Peblingesøen i det Indre København har vi masser af besøgende året rundt.\n\nNår udendørs servering tillader det åbner vi op for vores egen bådebro samt udendørs nyåbnet bar med beliggenhed i Peblingesøen. Her har vi 200 siddepladser samt 50 ekstra loungepladser. På bådebroen har vi masser af aktiviteter og arrangementer i form af koncerter, bådudlejning og dans.\n\nPå Kaffesalonen går vi op i kvalitet, og vores mad er derfor altid lavet på friske lækre råvarer. Vi stræber os efter at caféen er et sted hvor man altid kan føle sig hjemme, hvilket også gør at vi har mange daglige stamkunder.\n\nVi glæder os til at byde dig velkommen.\nDe bedste hilser Kaffesalonen', 49, 1),
(2008, '', '', 50, 1),
(2047, 'Overskift', 'Her kan du skrive oplysninger om dit sted!', 51, 1),
(2089, 'Kaffekilden', 'En fredelig oase midt i byen. Egen unik blend af friskkværnede kaffebønner, hjemmelavet cheesecake (mange lækre varianter) morgentallerken, gratis wi-fi, mange siddepladser, hyggelige sofa lounges, morgenmad.', 52, 1),
(2134, 'Moqa', 'Kaffe og kage går hånd i hånd på samme måde som kys og kærlighed. Med hjemmelavede tærter og andre lækkerier i glasmontren danner MOQA kaffebar rammerne for hyggelige vennetræf og kaffepauser på Nørrebro.\n \nHos MOQA kaffebar går vi højt op i, at kvalitet, service og atmosfære hver dag spiller sammen, hvilket vi sikrer ved hjælp af friske råvarer, dygtige medarbejdere og en varm og hyggelig indretning, der giver en følelse af at træde ind i en dagligstue.\n \nHer får du mulighed for at koble fra, og bare slappe af et øjeblik. Snup en kop dampende varm kaffe eller en kølig forfriskning sammen med en god kage eller bare nyde den gode stemning i vores hyggelige lokaler. \n \nSkulle du være sulten er det også noget vi kan klare. Vi har flere forskellige lette og velsmagende retter på menuen.\n? selvfølgelig lavet af de bedste råvarer.\n \nVi glæder os til at se dig.', 53, 1),
(2135, 'Overskift', 'Her kan du skrive oplysninger om dit sted!', 54, 1),
(2138, 'Overskrift', 'Her er en test"\n\ndkdnkdn', 1, 1),
(2159, 'Velkommen til Kalles Kaffe', 'Kalles Kaffe er en del af voom.dk, hos VOOM handler det om udsøgt kvalitet og bæredygtighed. Det handler om den gode stemning. Vi har mange gode intentioner og bidrager gerne til velgørenhedsarrangementer med en del af omsætningen, så tøv ikke med at kontakte os, hvis du har gode forslag. Hos voom lever vi af tilfredse kunder og samarbejdspartnere, vi er seriøse og til at snakke med.\n\nGrundstenene til VOOM blev sat med etableringen af Kalles Kaffe af Jacob Karlsen (Kalle). Siden har det udviklet sig til også at omfatte en række andre mobile gourmet services. Kalle hjælpes af sit friske og rutinerede crew, til at give sine kunder en dejlig oplevelse. Om det er til et lille privat arrangement eller som underleverandør til et kæmpe arrangement i samarbejde med eventbureauer ell. lignende, så er VOOM altid garant, for den gode kvalitet og profesionelle udførelse. Vi holder til på Amager, men begrænses ikke af vores placering, vi har varevogne og autotrailere, som kan bringe vores materiel og personale til resten af landet eller måske til udlandet!?', 55, 1),
(2252, 'Velkommen til Café Bizzaro', 'Er en af de ældste caféer på Amager, åbnede dørene første gang i maj 1996. Lige siden har Café Bizzaro været gennem en enorm udvikling med flere udvidelser, uden at gå på kompromis med den originale caféstemning.', 56, 1),
(2268, 'Om W+K', '\nWulff og Konstali Food Shop startede i 2005 på Islands Brygge og udvidede i 2011 med nr. 2 forretning på Lergravsvej 57 på Amager, et dengang lidt øde område, men med tiden flere og flere beboelsesbyggerier og mange sultne og kræsne gæster. Gæster der sætter pris på ærlig og god mad kombineret med bageriet i moderne inspirerende omgivelser. W+K Food Shop er et madsted, eat in eller take away. Vi elsker at lave mad og bage til vores gæster og stræber efter at give dem en skøn, sund og anderledes smagsoplevelse fra morgen til aften alle ugens dage. Der udvikles altid nye opskrifter og vi følger tidens trends og smag, derfor vil vi evigt eksperimentere med kokkerierne i vores køkken.\n\nSom et gammeldags cafeteria vælger man mellem de mange fristelser på hylderne og køledisken, hvad enten der er til morgenmad, brunch, lunch eller dinner. Alle salater og sandwiches laves i løbet af dagen, så det er frisk fra fad. På Lergravsvej kan man også krydse ønsker af på en brunch-spiseseddel. Vælg mellem flere forskellige små retter som tilberedes af kokken i det åbne køkken, så du kan følge din mad fra køl til mave.\nDagens frokost varierer daglig med alt fra husmandskost til de nyeste madtrends. For at lette aftensmåltidet for de travle har vi udviklet vores helt egne frostvarer Manamanam, hvor vores kok har tilberedt årstidsinspirerede gryderetter og supper. Bare tag med hjem, varm op, køb evt. brød og salat, kog ris eller pasta, så er der aftensmad på kort tid. Du kan altid tjekke ugens retter på instagram: @wulffogkonstali eller Facebook.\n\nWulff og Konstali Foodshop drives af madentreprenøren Poul Wulff, der også er indehaver af Cafe Alma på Islands Brygge. Tidligere var Thor Konstali en del af duoen, men han rejste tilbage til køkkenet i Norge. Poul fortsatte og har i dag stadig et stærkt team af madentusiaster, der brænder for madlavning på de bedste råvarer, serveret med smil og i stil.', 57, 1),
(2315, 'Velkommen til restaurant Sundby Sejl', 'Café, Restaurant &amp; Selskabslokaler', 58, 1),
(2427, 'Velkommen til CAFÉ LAVENTO', 'Cafe Lavento er en forholdsvis stor cafe placeret på anden sal i Fields.Lækkert udvalg af kaffespecialiteter, drikkevarer samt veltilberedte sandwiches, salater og varme retter i dejlige omgivelser.. Café Lavento er bestemt et besøg værd! \nVi har siden Fields opførsel arbejdet på at give københavnerne og turisterne i vores dejlige by en god café.\nVores mål er at servere et godt produkt, med et smil og en behagelig service\n? i hyggelige omgivelser. Kom og nyd en god kop kaffe, en frisk salat og et lækkert stykke kage, når du er træt efter at shoppe.\nVi byder dig velkommen til vores café.', 59, 1),
(2455, 'Hvem er vi?', 'Kaffekværnen er et mobilt kaffekoncept, der serverer velsmagende, friskbrygget, fairtradekaffe til dig, der sætter pris på kvalitet og en lille lykkerus i hverdagen.\n\nVi kombinerer ægte nydelse med et fleksibelt og mobil kaffekoncept, så vi kan give dig den gode smagsoplevelse på farten, på jobbet eller til firmaarrangementet.\n\nKaffekværnen er udsprunget af opfindsomhed, et ønske om kvalitet i højsædet og en oprigtig passion for kaffe.\nEn passion ? vi gerne vil dele med dig.\n\nVelkommen til kaffekværnen.', 60, 1);
