(48043, 'Kaffecyklen hos din virksomhed', '', 'Hos Kaffekværnen mener vi, at alle har ret til en god kop kaffe. Og hvorfor ikke belønne dine medarbejdere med et velsmagende pusterum? Vores dygtige baristaer bringer lækker fairtrade kaffe til din virksomhed med vores specialbyggede, hyggelige kaffecykel. Alt hvad vi behøver, er en stikkontakt og så er kaffen klar!', '', 1, '5396cf22c55cb48043', 2, 8066),
(48044, 'Kaffecyklen til din event', '', 'Til messer, konferencer og møder er pladsen ofte trang, men dette er ingen forhindring for Kaffecyklen.\nVores dygtige baristaer tilbyder friskkværnet kvalitetskaffe lige efter din smag. Udover lækker fairtrade kaffe, byder vi gerne eventets gæster på the, chai eller kakao.\nEt stop ved kaffecyklen giver ganske enkelt glade gæster med fornyet energi.', '', 1, '5396cf22c5bf448044', 3, 8066),
(48045, 'Espresso', '', 'Ordet espresso er kort for det italienske caffé espresso, hvilket betyder kaffe under tryk. Espresso brygges under tryk og adskiller sig fra almindelig kaffe ved at være væsentligt mere koncentreret, både i smag og konsistens. Endvidere er espresso kendetegnet ved at have et fint lag gyldent skum på toppen. Dette lag kaldes for crema.', '', 1, '5396cf22c74b348045', 2, 8069),
(48047, 'Latte Macchiato', '', 'Ligeledes betyder ordet macchiato på italiensk plettet. Bogstaveligt betyder latte macchiatto en plettet mælk. Det er derfor en meget svag kaffe, med en anelse espresso, der kommes i efter mælken er blevet skummet så der kommer en brun plet efter espressoen.', '', 1, '5396cf22c7fea48047', 4, 8069),
(48048, 'Cortado', '', 'Ordet cortado betyder på spansk skåret/afkortet. Hos Kaffekværnen er en cortado bestående af lige dele espresso med lige dele varmet mælk  50/50. Den er serveret så espressoens crema stadig ligger ubrudt på toppen.', '', 1, '5396cf22c858148048', 5, 8069),
(48051, 'Karamel Latte', '', 'Dette er en almindelig kaffe latte med karamelsirup i bunden inden der brygges espresso.', '', 1, '5396cf22c964248051', 8, 8069);
